webpackJsonp([0x7e06bd84c60a],{727:function(t,e){t.exports={data:{markdownRemark:{html:'<p>They were bred by Sauron in the late Third Age, possibly for the same reason Saruman bred the Uruk-hai, for improvement and less vulnerability to sunlight. They lived primarily in Mordor and in southern Mirkwood.</p>\n<h2>Abilities</h2>\n<p>Olog-Hais receive a bonus to bashing and have a natural health and move regeneration. This race is intended for seasoned players because of their complete lack of mystic and mage skills. Olog-Hais are an extreme warrior race and can\'t be targetted by any healing spells due to their natural regeneration.</p>\n<table class="table">\n    <thead>\n        <tr>\n            <th>Strength</th>\n            <th>Intelligence</th>\n            <th>Will</th>\n            <th>Dexterity</th>\n            <th>Constitution</th>\n            <th>Learning Ability</th>\n        </tr>\n    </thead>\n    <tbody>\n        <tr>\n            <td>Very High</td>\n            <td>Very Low</td>\n            <td>Very Low</td>\n            <td>Low</td>\n            <td>Very High</td>\n            <td>Very Low</td>\n        </tr>\n    </tbody>\n</table>',frontmatter:{title:"Olog-Hais",raceid:17}}},pathContext:{path:"/races/olog-hais"}}}});
